#Region @DOC
#### Description:
#This process manages the multi-threaded execution of tasks
#
#### How to Use:
#
#- `pTaskList` defines the tasks that the process will execute. 
#The parameter must be a JSON Array of JSON Objects, e.g. `[{...}, {...}, ..., {...}]`. 
#The JSON Objects within pTaskList can have the following key-values:
#```json
#{
#  "process": <string, REQUIRED>,
#  "parameters": <JSON Object, OPTIONAL>,
#  "id": <string, OPTIONAL>,
#  "predecessors": <JSON Array, OPTIONAL>,
#  "require_predecessor_success": <boolean, OPTIONAL>
#}
#```
#How to use each key-value pair:
#- `process`: REQUIRED: the name of the process.
#- `parameters`: OPTIONAL: A JSON Object specifying the parameter values of the process. (It is not required to list all the parameters of the process).
#- `id`: OPTIONAL: an ID string that other tasks can use to reference this task.
#- `predecessors`: OPTIONAL: A JSON Array of task ID strings.
#- `require_predecessor_success`: OPTIONAL: JSON boolean, if true the task will not be executed if any of it's predecessors failed (default = false).
#
#Here is an example pTaskList:
#```json
#[
#  {
#    "process": "}bedrock.server.wait"
#  },
#  {
#    "process": "}bedrock.server.wait",
#    "parameters": {
#      "pWaitSec": 10,
#      "pLogOutput": 1
#    },
#    "id": "second_task"
#  },
#  {
#    "process": "}bedrock.server.wait",
#    "parameters": {
#      "pWaitSec": 15
#    },
#    "predecessors": ["second_task"],
#    "require_predecessor_success": true
#  }
#]
#```
#This task list has three tasks, and each task is the process "}bedrock.server.wait". 
#If this task list is executed with pMaxThreads = 1, given the predecessors specified, the order of execution will be: the first or second task will execute first, but the third will not execute until the second task finishes executing.
#
#- `pMaxThreads` defines the maximum number of threads allowed to run concurrently.
#- `pRefreshRate` defines the number of milliseconds to wait in between checking the statuses of the created threads.
#- `pSuccessReturnCodes` is a JSON array with either the numeric value of a return code (e.g. 0, 5, 7, 8) or the strings of the return code function (e.g. "ProcessExitNormal", "ProcessExitByBreak", "ProcessExitMinorError"). 
#You can also shorten the strings by removing the "ProcessExit" prefix (e.g. "Normal", ByBreak", "MinorError").
#
#> [!IMPORTANT]
#> The executor ignores the order of the tasks in the list. So if you want a specific task to execute before another, only way to gaurantee that behavior is to use "predecessors".
#EndRegion @DOC

### Global Variables
pJson = IF( pJson @= '', '{}', pJson );
StringGlobalVariable(  'sBedrockReturnValue' );
NumericGlobalVariable( 'nBedrockReturnValue' );

### Constants ###
cThisProcName   = GetProcessName();
cUserName       = TM1User();
cTimeStamp      = TimSt( Now, '\Y\m\d\h\i\s' );
cRandomInt      = NumberToString( INT( RAND( ) * 1000 ));
cTemp           = cThisProcName |'_'| cTimeStamp |'_'| cRandomInt;
sMessages       = '{"Process": "'|cThisProcName|'", "User": "'|cUsername|'", "Info": ["Process: '''|cThisProcName|''' run by User: '''|cUsername|'''."], "Error": []}';


#################################################################################################
#Region - Process Parameters

pJson = IF( JsonType( pJson ) @<> 'object', '{}', pJson );
sMessages = '{"Process": "'|GetProcessName()|'", "User": "'|TM1User()|'", "Info": ["Process: '''|GetProcessName()|''' run by User: '''|TM1User()|'''."], "Error": []}';
pDefaultParameters = '{
  "pSuccessReturnCodes":  "[0, 5, 7, 8]",
  "pTaskList":            null,
  "pLogOutput":           0,
  "pMaxThreads":          0,
  "pRefreshRate":         100,
  "pStrictErrorHandling": 0
}';

pPassedParameters = '{
  "pSuccessReturnCodes":  '|StringToJson  ( pSuccessReturnCodes  )|',
  "pTaskList":            '|StringToJson  ( pTaskList            )|',
  "pLogOutput":           '|NumberToString( pLogOutput           )|',
  "pMaxThreads":          '|NumberToString( pMaxThreads          )|',
  "pRefreshRate":         '|NumberToString( pRefreshRate         )|',
  "pStrictErrorHandling": '|NumberToString( pStrictErrorHandling )|'
}';

pJson = JsonMergePatch( pPassedParameters, pJson );
# String Parameters
pSuccessReturnCodes  =                 JsonToString( pJson, '/pSuccessReturnCodes'  );
pTaskList            =                 JsonToString( pJson, '/pTaskList'            );
# Numeric Parameters
pLogOutput           = StringToNumber( JsonToString( pJson, '/pLogOutput'           ) );
pMaxThreads          = StringToNumber( JsonToString( pJson, '/pMaxThreads'          ) );
pRefreshRate         = StringToNumber( JsonToString( pJson, '/pRefreshRate'         ) );
pStrictErrorHandling = StringToNumber( JsonToString( pJson, '/pStrictErrorHandling' ) );

### Get the parameters that differ from the default
pDiffer = JsonDiff( pDefaultParameters, pJson );
nSize = JsonSize( pDiffer );
WHILE( nSize > 0 );
  nSize = nSize - 1;
  pDiffer = JsonReplace( pDiffer, '/'|NumberToString( nSize )|'/op', '"add"' );
END;
pJson = JsonPatch( '{}', pDiffer );

### LogOutput parameters
nSize = JsonSize( pJson );
WHILE( nSize > 0 );
  nSize = nSize - 1;
  sKey = JsonGetKey( pJson, nSize );
  pPassedParameters = JsonReplace( pPassedParameters, sKey, JsonGet( pJson, sKey ) );
END;

sMessages = JsonAdd( sMessages, '/Info/0', pPassedParameters );
IF( pLogOutput = 1 );
  LogOutput('INFO', JsonToString( sMessages, '/Info/0' ) );
ENDIF;

#EndRegion - Process Parameters
#################################################################################################

#################################################################################################
#Region - Validate Parameters

# pTaskJson must be a valid JSON
IF( JsonSize( pTaskList ) = 0 );
  sMessages = JsonAdd( sMessages, '/Info/-', StringToJson( '''pJsonTask'' is empty.' ) );
ELSEIF( JsonSize( pTaskList ) = -1 );
  sMessages = JsonAdd( sMessages, '/Error/-', StringToJson( '''pJsonTask'' is not a valid JSON string.' ) );
ENDIF;

IF( pSuccessReturnCodes @= '' );
  pSuccessReturnCodes = '[]';
ENDIF;

# Convert pSuccessReturnCodes to array of numbers
pSuccessReturnCodesType = JsonType( pSuccessReturnCodes );
IF( pSuccessReturnCodesType @= 'number' % pSuccessReturnCodesType @= 'string' );
  pSuccessReturnCodes = '['|pSuccessReturnCodes|']';
ELSEIF( pSuccessReturnCodesType @<> 'array' );
  pSuccessReturnCodes = '['|StringToJson( pSuccessReturnCodes )|']';
ENDIF;

nSuccessReturnCodes = JsonSize( pSuccessReturnCodes );
WHILE( nSuccessReturnCodes > 0 );
  nSuccessReturnCodes = nSuccessReturnCodes - 1;
  sReturnCode = JsonGet( pSuccessReturnCodes, nSuccessReturnCodes );
  IF( JsonType( sReturnCode ) @= 'string' );
    sReturnCode = JsonToString( sReturnCode );
    sReturnCode = UPPER( sReturnCode );
    
    IF( SUBST( sReturnCode, LONG( sReturnCode ) - 2, 2 ) @= '()' );
      sReturnCode = SUBST( sReturnCode, 1, LONG( sReturnCode ) - 2 );
    ENDIF;
    IF( SUBST( sReturnCode, 1, 11 ) @= 'PROCESSEXIT' );
      sReturnCode = DELET( sReturnCode, 1, 11 );
    ENDIF;
    
    IF( sReturnCode @= 'BYBREAK' );           sReturnCode = NumberToString( ProcessExitByBreak() ); ENDIF;
    IF( sReturnCode @= 'BYCHOREQUIT' );       sReturnCode = NumberToString( ProcessExitByChoreQuit() ); ENDIF;
    IF( sReturnCode @= 'BYCHOREROLLBACK' );   sReturnCode = NumberToString( ProcessExitByChoreRollback() ); ENDIF;
    IF( sReturnCode @= 'BYPROCESSROLLBACK' ); sReturnCode = NumberToString( ProcessExitByProcessRollback() ); ENDIF;
    IF( sReturnCode @= 'BYQUIT' );            sReturnCode = NumberToString( ProcessExitByQuit() ); ENDIF;
    IF( sReturnCode @= 'BYMINORERROR' );      sReturnCode = NumberToString( ProcessExitMinorError() ); ENDIF;
    IF( sReturnCode @= 'NORMAL' );            sReturnCode = NumberToString( ProcessExitNormal() ); ENDIF;
    IF( sReturnCode @= 'ONINIT' );            sReturnCode = NumberToString( ProcessExitOnInit() ); ENDIF;
    IF( sReturnCode @= 'SERIOUSERROR' );      sReturnCode = NumberToString( ProcessExitSeriousError() ); ENDIF;
    IF( sReturnCode @= 'WITHMESSAGE' );       sReturnCode = NumberToString( ProcessExitWithMessage() ); ENDIF;
    
    pSuccessReturnCodes = JsonReplace( pSuccessReturnCodes, nSuccessReturnCodes, sReturnCode );
  ENDIF;
END;
    

### If errors occurred terminate process with a major error status ###
If( JsonSize( sMessages, '/Error' ) <> 0 );
    ProcessBreak;
EndIf;

IF( pMaxThreads <= 0 );
  pMaxThreads = JsonSize( pTaskList );
ENDIF;

#EndRegion - Validate Parameters
#################################################################################################


#################################################################################################
#Region - Main Process

### Initial Starting Parameters ###
sJsonCompletedJobs = '{}';
sJsonCompletedJobsStatus = '{}';

nTaskCount = JsonSize( pTaskList ) - 1;
WHILE( nTaskCount >= 0 );
  sJsonTask = JsonGet( pTaskList, nTaskCount );
  sID = JsonToString( JsonGet( sJsonTask, 'id' ) );
  IF( sID @<> '' );
    sCurrentCount = JsonGet( sJsonCompletedJobs, sID );
    nCurrentCount = IF( sCurrentCount @= '', 0, StringToNumber( sCurrentCount ) ) + 1;
    sJsonCompletedJobs = JsonAdd( sJsonCompletedJobs, sID, NumberToString( nCurrentCount ) );
  ENDIF;
  
  nTaskCount = nTaskCount - 1;
END;

### Start of Main Loop ###
nTaskListIndex = 0;
sListThreadPool = '[]';
WHILE( JsonSize( pTaskList ) <> 0 );
  
  ### Initial Task Parameters ###
  # Get task from task list
  sJsonTask = JsonGet( pTaskList, nTaskListIndex );
  
  # Get parameters of task
  sProcessName = JsonToString( sJsonTask, '/process' );
  sID = JsonToString( sJsonTask, '/id' );
  sJsonParameters = JsonGet( sJsonTask, 'parameters' );
  sRequireSuccess = JsonGet( sJsonTask, 'require_predecessor_success' );
  sPredecessors = JsonGet( sJsonTask, 'predecessors' );
  
  ### Get Predecessor Return Status ###
  # Loop through the predecessors
  nPredecessorsFinished = 1;
  nPredecessorCount = JsonSize( sPredecessors );
  WHILE( nPredecessorCount > 0 );
    nPredecessorCount = nPredecessorCount - 1;
    sPredecessorID = JsonToString( sPredecessors, nPredecessorCount );
    sPredecessorStatus = JsonGet( sJsonCompletedJobs, sPredecessorID );
    
    # If the predecessor doesn't exist, raise an error
    IF( sPredecessorStatus @= '' );
      sMessages = JsonAdd( sMessages, '/Error/-', StringToJson( 'task with ID '''|sID|''' has predecessor '''|sPredecessorID|''' that doesn''t exist. Task will not be executed.' ) );
      pTaskList = JsonRemove( pTaskList, nTaskListIndex );
      nTaskListIndex = 0;
      IF( pStrictErrorHandling = 1 );
        ProcessBreak;
      ENDIF;
    ELSE;
      # Get the number of tasks with sPredecessorID that still need to finish
      nPredecessorStatus = StringToNumber( sPredecessorStatus );
      IF( nPredecessorStatus > 0 );
        nPredecessorsFinished = 0;
        BREAK;
      # If needed, get the completion status of the predecessor
      ELSEIF( sRequireSuccess @= 'true' );
        sJobCompletionStatus = JsonGet( sJsonCompletedJobsStatus, sPredecessorID );
        IF( sJobCompletionStatus @= 'false' );
          sMessageLevel = IF( pStrictErrorHandling = 1, 'Error', 'Info' );
          sMessages = JsonAdd( sMessages, '/'|sMessageLevel|'/-', StringToJson( 'Job with ID '''|sID|''' did not run due to predecessor with ID '''|sPredecessorID|''' having an unacceptable return code.' ) );
          pTaskList = JsonRemove( pTaskList, nTaskListIndex );
          nTaskListIndex = 0;
          nPredecessorsFinished = 0;
          BREAK;
        ENDIF;
      ENDIF;
    ENDIF;
  END;
  
  ### Call Task with Given Parameters ###
  # Continue if all predecessors have finished and there is room in the thread pool
  IF( nPredecessorsFinished = 1 & JsonSize( sListThreadPool ) < pMaxThreads );
    sMessages = JsonAdd( sMessages, '/Info/-', StringToJson( 'Starting Job: '|sJsonTask ) );
    IF( pLogOutput = 1 ); LogOutput( 'INFO', JsonGet( JsonGet( sMessages, '/Info' ), JsonSize( sMessages, '/Info' )-1 ) ); ENDIF;
    pTaskList = JsonRemove( pTaskList, nTaskListIndex );
    nTaskListIndex = 0;
    
    # Note: Variable names shortened for scalability
    sPN = sProcessName;
    
    # Json Numeric/String Parameters
    sJNP = '{}';
    sJSP = '{}';
    WHILE( JsonSize( sJsonParameters ) > 0 );
      sKey = JsonGetKey( sJsonParameters, 0 );
      sVal = JsonGet( sJsonParameters, sKey );
      sJsonParameters = JsonRemove( sJsonParameters, sKey );
      
      IF( JsonType( sVal ) @= 'number' );
        sJNP = JsonAdd( sJNP, sKey, sVal );
      ELSE;
        sJSP = JsonAdd( sJSP, sKey, sVal );
      ENDIF;
    END;
    # String/Numeric Count
    nNC = JsonSize( sJNP );
    nSC = JsonSize( sJSP );
    
    # Retrieve Process Parameters from Json Numeric/String Parameters
    sNK001 = JsonGetKey( sJNP, 000 );
    sSK001 = JsonGetKey( sJSP, 000 );
    sNK002 = JsonGetKey( sJNP, 001 );
    sSK002 = JsonGetKey( sJSP, 001 );
    #Region - ...
    sNK003 = JsonGetKey( sJNP, 002 );
    sSK003 = JsonGetKey( sJSP, 002 );
    sNK004 = JsonGetKey( sJNP, 003 );
    sSK004 = JsonGetKey( sJSP, 003 );
    sNK005 = JsonGetKey( sJNP, 004 );
    sSK005 = JsonGetKey( sJSP, 004 );
    sNK006 = JsonGetKey( sJNP, 005 );
    sSK006 = JsonGetKey( sJSP, 005 );
    sNK007 = JsonGetKey( sJNP, 006 );
    sSK007 = JsonGetKey( sJSP, 006 );
    sNK008 = JsonGetKey( sJNP, 007 );
    sSK008 = JsonGetKey( sJSP, 007 );
    sNK009 = JsonGetKey( sJNP, 008 );
    sSK009 = JsonGetKey( sJSP, 008 );
    sNK010 = JsonGetKey( sJNP, 009 );
    sSK010 = JsonGetKey( sJSP, 009 );
    sNK011 = JsonGetKey( sJNP, 010 );
    sSK011 = JsonGetKey( sJSP, 010 );
    sNK012 = JsonGetKey( sJNP, 011 );
    sSK012 = JsonGetKey( sJSP, 011 );
    sNK013 = JsonGetKey( sJNP, 012 );
    sSK013 = JsonGetKey( sJSP, 012 );
    sNK014 = JsonGetKey( sJNP, 013 );
    sSK014 = JsonGetKey( sJSP, 013 );
    sNK015 = JsonGetKey( sJNP, 014 );
    sSK015 = JsonGetKey( sJSP, 014 );
    sNK016 = JsonGetKey( sJNP, 015 );
    sSK016 = JsonGetKey( sJSP, 015 );
    sNK017 = JsonGetKey( sJNP, 016 );
    sSK017 = JsonGetKey( sJSP, 016 );
    sNK018 = JsonGetKey( sJNP, 017 );
    sSK018 = JsonGetKey( sJSP, 017 );
    sNK019 = JsonGetKey( sJNP, 018 );
    sSK019 = JsonGetKey( sJSP, 018 );
    #EndRegion - ...
    sNK020 = JsonGetKey( sJNP, 019 );
    sSK020 = JsonGetKey( sJSP, 019 );
    
    sNV001 = IF( sNK001 @= '', 0, StringToNumber( JsonGet( sJNP, sNK001 ) ) );
    sSV001 = IF( sSK001 @= '', '', JsonToString(  JsonGet( sJSP, sSK001 ) ) );
    sNV002 = IF( sNK002 @= '', 0, StringToNumber( JsonGet( sJNP, sNK002 ) ) );
    sSV002 = IF( sSK002 @= '', '', JsonToString(  JsonGet( sJSP, sSK002 ) ) );
    #Region - ...
    sNV003 = IF( sNK003 @= '', 0, StringToNumber( JsonGet( sJNP, sNK003 ) ) );
    sSV003 = IF( sSK003 @= '', '', JsonToString(  JsonGet( sJSP, sSK003 ) ) );
    sNV004 = IF( sNK004 @= '', 0, StringToNumber( JsonGet( sJNP, sNK004 ) ) );
    sSV004 = IF( sSK004 @= '', '', JsonToString(  JsonGet( sJSP, sSK004 ) ) );
    sNV005 = IF( sNK005 @= '', 0, StringToNumber( JsonGet( sJNP, sNK005 ) ) );
    sSV005 = IF( sSK005 @= '', '', JsonToString(  JsonGet( sJSP, sSK005 ) ) );
    sNV006 = IF( sNK006 @= '', 0, StringToNumber( JsonGet( sJNP, sNK006 ) ) );
    sSV006 = IF( sSK006 @= '', '', JsonToString(  JsonGet( sJSP, sSK006 ) ) );
    sNV007 = IF( sNK007 @= '', 0, StringToNumber( JsonGet( sJNP, sNK007 ) ) );
    sSV007 = IF( sSK007 @= '', '', JsonToString(  JsonGet( sJSP, sSK007 ) ) );
    sNV008 = IF( sNK008 @= '', 0, StringToNumber( JsonGet( sJNP, sNK008 ) ) );
    sSV008 = IF( sSK008 @= '', '', JsonToString(  JsonGet( sJSP, sSK008 ) ) );
    sNV009 = IF( sNK009 @= '', 0, StringToNumber( JsonGet( sJNP, sNK009 ) ) );
    sSV009 = IF( sSK009 @= '', '', JsonToString(  JsonGet( sJSP, sSK009 ) ) );
    sNV010 = IF( sNK010 @= '', 0, StringToNumber( JsonGet( sJNP, sNK010 ) ) );
    sSV010 = IF( sSK010 @= '', '', JsonToString(  JsonGet( sJSP, sSK010 ) ) );
    sNV011 = IF( sNK011 @= '', 0, StringToNumber( JsonGet( sJNP, sNK011 ) ) );
    sSV011 = IF( sSK011 @= '', '', JsonToString(  JsonGet( sJSP, sSK011 ) ) );
    sNV012 = IF( sNK012 @= '', 0, StringToNumber( JsonGet( sJNP, sNK012 ) ) );
    sSV012 = IF( sSK012 @= '', '', JsonToString(  JsonGet( sJSP, sSK012 ) ) );
    sNV013 = IF( sNK013 @= '', 0, StringToNumber( JsonGet( sJNP, sNK013 ) ) );
    sSV013 = IF( sSK013 @= '', '', JsonToString(  JsonGet( sJSP, sSK013 ) ) );
    sNV014 = IF( sNK014 @= '', 0, StringToNumber( JsonGet( sJNP, sNK014 ) ) );
    sSV014 = IF( sSK014 @= '', '', JsonToString(  JsonGet( sJSP, sSK014 ) ) );
    sNV015 = IF( sNK015 @= '', 0, StringToNumber( JsonGet( sJNP, sNK015 ) ) );
    sSV015 = IF( sSK015 @= '', '', JsonToString(  JsonGet( sJSP, sSK015 ) ) );
    sNV016 = IF( sNK016 @= '', 0, StringToNumber( JsonGet( sJNP, sNK016 ) ) );
    sSV016 = IF( sSK016 @= '', '', JsonToString(  JsonGet( sJSP, sSK016 ) ) );
    sNV017 = IF( sNK017 @= '', 0, StringToNumber( JsonGet( sJNP, sNK017 ) ) );
    sSV017 = IF( sSK017 @= '', '', JsonToString(  JsonGet( sJSP, sSK017 ) ) );
    sNV018 = IF( sNK018 @= '', 0, StringToNumber( JsonGet( sJNP, sNK018 ) ) );
    sSV018 = IF( sSK018 @= '', '', JsonToString(  JsonGet( sJSP, sSK018 ) ) );
    sNV019 = IF( sNK019 @= '', 0, StringToNumber( JsonGet( sJNP, sNK019 ) ) );
    sSV019 = IF( sSK019 @= '', '', JsonToString(  JsonGet( sJSP, sSK019 ) ) );
    #EndRegion - ...
    sNV020 = IF( sNK020 @= '', 0, StringToNumber( JsonGet( sJNP, sNK020 ) ) );
    sSV020 = IF( sSK020 @= '', '', JsonToString(  JsonGet( sJSP, sSK020 ) ) );
    
    
    # Based on number of String/Numeric parameters, call RunProcess
    IF    ( nNC = 000 );
      IF    ( nSC = 000 );
        sPID = RunProcess( sPN );
      ELSEIF( nSC = 001 );
        sPID = RunProcess( sPN, sSK001, sSV001 );
      ELSEIF( nSC = 002 );
        sPID = RunProcess( sPN, sSK001, sSV001, sSK002, sSV002 );
      #Region - ...
      ELSEIF( nSC = 003 );
        sPID = RunProcess( sPN, sSK001, sSV001, sSK002, sSV002, sSK003, sSV003 );
      ELSEIF( nSC = 004 );
        sPID = RunProcess( sPN, sSK001, sSV001, sSK002, sSV002, sSK003, sSV003, sSK004, sSV004 );
      ELSEIF( nSC = 005 );
        sPID = RunProcess( sPN, sSK001, sSV001, sSK002, sSV002, sSK003, sSV003, sSK004, sSV004, sSK005, sSV005 );
      ELSEIF( nSC = 006 );
        sPID = RunProcess( sPN, sSK001, sSV001, sSK002, sSV002, sSK003, sSV003, sSK004, sSV004, sSK005, sSV005, sSK006, sSV006 );
      ELSEIF( nSC = 007 );
        sPID = RunProcess( sPN, sSK001, sSV001, sSK002, sSV002, sSK003, sSV003, sSK004, sSV004, sSK005, sSV005, sSK006, sSV006, sSK007, sSV007 );
      ELSEIF( nSC = 008 );
        sPID = RunProcess( sPN, sSK001, sSV001, sSK002, sSV002, sSK003, sSV003, sSK004, sSV004, sSK005, sSV005, sSK006, sSV006, sSK007, sSV007, sSK008, sSV008 );
      ELSEIF( nSC = 009 );
        sPID = RunProcess( sPN, sSK001, sSV001, sSK002, sSV002, sSK003, sSV003, sSK004, sSV004, sSK005, sSV005, sSK006, sSV006, sSK007, sSV007, sSK008, sSV008, sSK009, sSV009 );
      ELSEIF( nSC = 010 );
        sPID = RunProcess( sPN, sSK001, sSV001, sSK002, sSV002, sSK003, sSV003, sSK004, sSV004, sSK005, sSV005, sSK006, sSV006, sSK007, sSV007, sSK008, sSV008, sSK009, sSV009, sSK010, sSV010 );
      ELSEIF( nSC = 011 );
        sPID = RunProcess( sPN, sSK001, sSV001, sSK002, sSV002, sSK003, sSV003, sSK004, sSV004, sSK005, sSV005, sSK006, sSV006, sSK007, sSV007, sSK008, sSV008, sSK009, sSV009, sSK010, sSV010, sSK011, sSV011 );
      ELSEIF( nSC = 012 );
        sPID = RunProcess( sPN, sSK001, sSV001, sSK002, sSV002, sSK003, sSV003, sSK004, sSV004, sSK005, sSV005, sSK006, sSV006, sSK007, sSV007, sSK008, sSV008, sSK009, sSV009, sSK010, sSV010, sSK011, sSV011, sSK012, sSV012 );
      ELSEIF( nSC = 013 );
        sPID = RunProcess( sPN, sSK001, sSV001, sSK002, sSV002, sSK003, sSV003, sSK004, sSV004, sSK005, sSV005, sSK006, sSV006, sSK007, sSV007, sSK008, sSV008, sSK009, sSV009, sSK010, sSV010, sSK011, sSV011, sSK012, sSV012, sSK013, sSV013 );
      ELSEIF( nSC = 014 );
        sPID = RunProcess( sPN, sSK001, sSV001, sSK002, sSV002, sSK003, sSV003, sSK004, sSV004, sSK005, sSV005, sSK006, sSV006, sSK007, sSV007, sSK008, sSV008, sSK009, sSV009, sSK010, sSV010, sSK011, sSV011, sSK012, sSV012, sSK013, sSV013, sSK014, sSV014 );
      ELSEIF( nSC = 015 );
        sPID = RunProcess( sPN, sSK001, sSV001, sSK002, sSV002, sSK003, sSV003, sSK004, sSV004, sSK005, sSV005, sSK006, sSV006, sSK007, sSV007, sSK008, sSV008, sSK009, sSV009, sSK010, sSV010, sSK011, sSV011, sSK012, sSV012, sSK013, sSV013, sSK014, sSV014, sSK015, sSV015 );
      ELSEIF( nSC = 016 );
        sPID = RunProcess( sPN, sSK001, sSV001, sSK002, sSV002, sSK003, sSV003, sSK004, sSV004, sSK005, sSV005, sSK006, sSV006, sSK007, sSV007, sSK008, sSV008, sSK009, sSV009, sSK010, sSV010, sSK011, sSV011, sSK012, sSV012, sSK013, sSV013, sSK014, sSV014, sSK015, sSV015, sSK016, sSV016 );
      ELSEIF( nSC = 017 );
